CREATE TABLE pokemon_species (
    id INT PRIMARY KEY,
    name VARCHAR(100) NOT NULL,
    order_ INT,
    gender_rate INT,
    capture_rate INT,
    base_happiness INT,
    is_baby BOOLEAN,
    hatch_counter INT,
    has_gender_differences BOOLEAN,
    forms_switchable BOOLEAN,
    evolution_chain_id INT,
    evolves_from_species_id INT,
    generation_id INT,
    growth_rate_id INT,
    pokemon_color_id INT,
    pokemon_habitat_id INT,
    pokemon_shape_id INT,
    is_legendary BOOLEAN,
    is_mythical BOOLEAN,
    FOREIGN KEY (evolution_chain_id) REFERENCES evolutions_chains(id),
    FOREIGN KEY (evolves_from_species_id) REFERENCES pokemon_species(id),
    FOREIGN KEY (generation_id) REFERENCES generations(id),
    FOREIGN KEY (growth_rate_id) REFERENCES growth_rates(id),
    FOREIGN KEY (pokemon_color_id) REFERENCES pokemon_colors(id),
    FOREIGN KEY (pokemon_habitat_id) REFERENCES pokemon_habitats(id),
    FOREIGN KEY (pokemon_shape_id) REFERENCES pokemon_shapes(id)
);


